           let parent = $('.produto .principal');

           if(produtoEspecifico){

               parent = $(produtoEspecifico);

           }

           let prevo_venda = parseFloat(ILUMINIM_UTILS.formatarPrecoParaPadraoJS(parent.find('.preco-produto .preco-venda').text()));
           let preco_promocional = parseFloat(ILUMINIM_UTILS.formatarPrecoParaPadraoJS(parent.find('.preco-produto .preco-promocional').text()));
           let valor_economizado = parseFloat(prevo_venda - preco_promocional).toFixed(2);
