   verificarFiltrosAtivo(){

       let url = location.href;

       $('.ordenar-listagem.topo .dropdown-menu li, .filtro-ordenar-por li').each(function(){
 
          let filtro_selecionado = $(this).find('a').attr('href');
       
          if(url.indexOf(filtro_selecionado) > -1) {
                $(this).addClass('filtro-ativo');
          }
 
       });

   },

   ajustePaginacao(){

       $('.ordenar-listagem .pagination ul > li').each(function(){
           
           let alvo = $(this).children('*');

           if(alvo.attr('rel') == 'next'){
               alvo.html('Próximo');
           }

           if(alvo.attr('rel') == 'prev'){
               alvo.html('Anterior');
           }

           if(alvo.html().includes('...')){
               
               $(this).attr('class', '');

               let [ novo_link, pagina ] = ($(this).prev().find('a').attr('href') || '').split('pagina=');
               let pagina_certa = parseInt(pagina) + 1;

               $(this).html(`<a href="${novo_link}pagina=${pagina_certa}" rel="nofollow">${pagina_certa}</a>`);

           }

       });

   },

