   adaptarFormasDeEnvioCarrinhoCheckout(){

       let targetCondicional = '.formas-envio span.nome:contains("|.|")';

       if( ILUMINIM_UTILS.pagina.isCheckout() ){

           targetCondicional = 'div#formas-envio-wrapper .envio-nome:contains("|.|")';

       } else if( ILUMINIM_UTILS.pagina.isProduct() ){

            targetCondicional = 'form#formCalcularCep+ul li span.nome:contains("|.|")'

       }

       let checkOpcaoFormaEnvio = setInterval(function(){

            console.log('Interval -> Validação da forma de envio -> Executada');

           if($(targetCondicional).length > 0){

               if(ILUMINIM_UTILS.pagina.isCart()){

                   $('.formas-envio > ul > li').each(function(){

                       let textoOpcaoFormaEnvio = $(this).find('.nome').html();
                       let textoOpcaoFormaEnvioFormatada = textoOpcaoFormaEnvio.replace('|.|', '')
                       //console.log(textoOpcaoFormaEnvioFormatada);
   
                       $(this).find('.nome').html(`${textoOpcaoFormaEnvioFormatada}`);
   
                   });
   
                   $('.formas-envio ul').append(`
                       <div class="sobre-frete">
                           <span class="text-white" data-target="#ModalRetiradaEmMaos" data-toggle="modal"><i class="fa fa-info-circle"></i> Saiba mais sobre retirada na loja</span>
                       </div>
                   `);

               } else if(ILUMINIM_UTILS.pagina.isCheckout()){

                   $('div#formas-envio-wrapper > *').each(function(){

                       let textoOpcaoFormaEnvio = $(this).find('.envio-nome').html();
                       let textoOpcaoFormaEnvioFormatada = textoOpcaoFormaEnvio.replace('|.|', '')
                       //console.log(textoOpcaoFormaEnvioFormatada);
   
                       $(this).find('.envio-nome').html(`${textoOpcaoFormaEnvioFormatada}`);
   
                   });
   
                   $('div#formas-envio-wrapper').append(`
                       <div class="sobre-frete">
                           <span class="text-white" data-target="#ModalRetiradaEmMaos" data-toggle="modal"><i class="fa fa-info-circle"></i> Saiba mais sobre retirada na loja</span>
                       </div>
                   `);

               } else if(ILUMINIM_UTILS.pagina.isProduct()){

                    $('form#formCalcularCep+ul > *').each(function(){

                       let textoOpcaoFormaEnvio = $(this).find('.nome').html();
                       let textoOpcaoFormaEnvioFormatada = textoOpcaoFormaEnvio.replace('|.|', '')
                       //console.log(textoOpcaoFormaEnvioFormatada);
   
                       $(this).find('.nome').html(`${textoOpcaoFormaEnvioFormatada}`);

                    });

                    $('form#formCalcularCep+ul').append(`
                        <div class="sobre-frete">
                            <span class="text-white" data-target="#ModalRetiradaEmMaos" data-toggle="modal"><i class="fa fa-info-circle"></i> Saiba mais sobre retirada na loja</span>
                        </div>
                    `);

               }

              setTimeout(function(){

                console.log('Interval -> Validação da forma de envio -> Encerrada');
                 clearInterval(checkOpcaoFormaEnvio);

              }, 2000);

           }

       }, 100);

       setTimeout(() => {

            console.log('Interval -> Validação da forma de envio -> Encerrada');
           clearInterval(checkOpcaoFormaEnvio);

       }, 5000);

   },

